import { useState } from "react";
import "./App.css";
function App() {
  const [header,setHeader]=useState("Enter your details")
  return (
    <div className="container">
      <div id='header'>{header}</div>
      <div><div className="labels">Enter your Name</div><div className="inputs"><input type='text' /></div></div>
      <div><div className="labels">Enter your Email</div><div className="inputs"><input type='email' /></div></div>
      <div><div className="labels">Enter your Password</div><div className="inputs"><input type='password' /></div></div>
      <div><div className="labels">Enter your Address</div><div className="inputs"><textarea/></div></div>
      <div><div className="labels">Enter your Mobile</div><div className="inputs"><input type='number' /></div></div>
      <div><div className="labels">Select your Gender</div><div className="inputs"><input type='radio' value="Male"/>Male<input type='radio' value="Female"/>Female</div></div>
      <div><div className="labels">Enter your Hobbies</div><div className="inputs"><input type='checkbox' value="Cricket"/><input type='checkbox' value="Singing"/><input type='checkbox' value="Dancing"/></div></div>
      <div><div className="labels">Enter Choose your Profile Pic</div><div className="inputs"><input type='image' alt="Browse" src="/src/components/image.png"/></div></div>
      <div><div className="labels">Select your DOB</div><div className="inputs"><select></select><select></select><select></select></div></div>
      <div id='footer'><button>Register Me</button><button>Reset</button></div>
    </div>
  );
}

export default App;
